function playerUpdate()

	if key(28) then
		maplist.current = 1
	elseif key(29) then
		maplist.current = 2
	end
	player.state = "idle"
	if btn(2) or key (01) then
		if player.vx > -player.maxax then
			player.vx = player.vx - (player.ax)
		end
		player.state = "left"
		player.flip = true
	else
		player.flip = false
	end
	if btn(3) or key(04) then
		if player.vx < player.maxax then
			player.vx = player.vx + (player.ax)
		end
		player.state = "right"
	end
	if (btn(0) or key(48)) and player.colliding[1] then
		player.vy = player.vy-(player.ay)
		player.state = "jump"
	end
	if btn(1) or key(63) then
		player.state = "crouch"
		--player.vx = player.vx*0.7
		--if player.vy > 0 then
		--	player.vy = player.vy*(0.9)
		--else
		--	player.vy = player.vy*(0.8)
		--end
		if player.x < gmouse().x then
			if gmouse().x < 0 or gmouse().x >= 240 or gmouse().y < 0 or gmouse().y >= 136 then
				trace("is out of window")
			else
				local angle, l = getAngleDistance(player,gmouse())
				if gmouse().vy == 0 then
					if (math.deg(angle) > 15 and math.deg(angle) < 90) then
						angle = math.rad(25)
					elseif (math.deg(angle) > 90 and math.deg(angle) < 181) then
						angle = math.rad(165)
					end
				end
				local tx = (math.sqrt((gmouse().x - player.x) * (gmouse().x - player.x)) * math.cos(angle) + player.x)
				local ty = (math.sqrt((gmouse().y - player.y) * (gmouse().y - player.y)) * math.sin(angle) + player.y)
				player.vx = tx
				player.vy = ty
			end
		else
			if gmouse().x < 0 or gmouse().x >= 240 or gmouse().y < 0 or gmouse().y >= 136 then
				trace("is out of window")
			else
				player.vx = player.vx - player.ax * math.sqrt((gmouse().x - player.x) * (gmouse().x - player.x))//10
				player.vy = player.vy - player.ay * math.sqrt((gmouse().y - player.y) * (gmouse().y - player.y))//20
			end
		end
	end

	if keyp(05) and useCooldown == 0 then
		if not player.isHolding then
			--grabobject(player)
		else
			--dropobject(player)
		end
		useCooldown = 10
	end
	if useCooldown > 0 then
		useCooldown = useCooldown-1
	end
	playerSpriteState()

	if player.isHolding then
		--holdobject(player, player.isHolding)
	end
end

