function playerSpriteState()

	if gmouse().x < player.x then
		player.flip = true
	else
		player.flip = false
	end

	if gmouse().x < player.x then
		player.spreyes = 351
	end

	if player.state == "idle" then --idle
		player.spval = 256
		player.sprhead = player.splist.idle.p[math.floor(tick/30 % #player.splist.idle.p) + 1]
		player.spreyes = player.splist.idle.e[math.floor(tick/30 % #player.splist.idle.e) + 1]
